import styles from './Company.module.css';

function Company() {
    return (
      <div>
        <section className={styles.company}>
        <h1>Cost Management</h1>
        <p>Uma aplicação para gerenciar seus projetos de forma mais eficaz</p>
        </section>
      </div>
    );
  }
  
export default Company;
